import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <ul className="navbar-nav bg-dark sidebar sidebar-dark accordion" id="accordionSidebar">
      {/* Logo */}
      <li className="nav-item text-center mt-3">
        <h3 className="text-white fw-bold">iDrive</h3>
      </li>

      <hr className="sidebar-divider my-2" />

      {/* Dashboard */}
      <li className="nav-item">
        <Link className="nav-link" to="/dashboard">
          <i className="fas fa-fw fa-tachometer-alt"></i>
          <span>Dashboard</span>
        </Link>
      </li>

      {/* Agendamientos */}
      <li className="nav-item">
        <Link className="nav-link" to="/agendamientos">
          <i className="fas fa-fw fa-calendar"></i>
          <span>Agendamientos</span>
        </Link>
      </li>

      {/* Usuarios */}
      <li className="nav-item">
        <Link className="nav-link" to="/usuarios">
          <i className="fas fa-fw fa-users"></i>
          <span>Usuarios</span>
        </Link>
      </li>

      {/* Clases */}
      <li className="nav-item">
        <Link className="nav-link" to="/clases">
          <i className="fas fa-fw fa-car"></i>
          <span>Clases</span>
        </Link>
      </li>

      <hr className="sidebar-divider d-none d-md-block" />
    </ul>
  );
};

export default Sidebar;
